import React, { Component } from 'react';

class ResourcesPage extends Component {
  render() {
    return (
      <div>
        <h1>Resources Page</h1>
        <p>Here are some resources you can use to learn about agriculture:</p>
        <ul>
          <li><a href="https://www.youtube.com/channel/UCdI5aQYlJlG5N5-5aOyFEIw">FarmersTV</a></li>
          <li><a href="https://www.youtube.com/channel/UCxjXU89x3BMRyI4Nz2N2XzQ">AgriLife Studios</a></li>
          <li><a href="https://www.youtube.com/channel/UC0Mz7TjK_RivSdhpjTRYusw">Krishi Jagran</a></li>
        </ul>
      </div>
    );
  }
}
const Resources = () => {
    return (
      <div className="resources-container">
        <h1 className="resources-header">Farmer Resources</h1>
        <ul className="resources-list">
          <li className="resources-item">
            <a className="resources-link" href="#">Resource 1</a>
          </li>
          <li className="resources-item">
            <a className="resources-link" href="#">Resource 2</a>
          </li>
          <li className="resources-item">
            <a className="resources-link" href="#">Resource 3</a>
          </li>
        </ul>
      </div>
    );
  };

export default ResourcesPage;
